            {
                if (oldOnBeforeSend)
                {
                    oldOnBeforeSend(xhr);
                }
                xhr.setRequestHeader('X-CSRFToken', that._token.value);
            };
        }
        else if(Configuration.SERVER_AUTHENTICATION_TYPE === 'token')
        {
            options.beforeSend = function (xhr)
            {
                if (oldOnBeforeSend)
                {
                    oldOnBeforeSend(xhr);
                }
                xhr.setRequestHeader('Authorization', 'Token ' + that._token.value);
            }
        }
    }

