     * That's the way Rodan works. :)
     *
     * @return {string} URL of Resource with trailing slash
     */
    url()
    {
        var original_url = Radio.channel('rodan').request(RODAN_EVENTS.REQUEST__SERVER_GET_ROUTE, this.routeName);
