/**
 * Global environment constants.
 */
export default class Environment
{
///////////////////////////////////////////////////////////////////////////////////////
// PUBLIC METHODS - Static
///////////////////////////////////////////////////////////////////////////////////////
    /**
     * Returns string denoting detected operating system.
     *
     * @return {string} 'Windows', 'MacOS', 'UNIX', 'Linux', or 'Unknown OS'
     */
    static getOS()
    {
        if (_os === null)
        {
            _os='Unknown OS';
            if (navigator.appVersion.indexOf('Win')!=-1) _os='Windows';
            if (navigator.appVersion.indexOf('Mac')!=-1) _os='MacOS';
            if (navigator.appVersion.indexOf('X11')!=-1) _os='UNIX';
            if (navigator.appVersion.indexOf('Linux')!=-1) _os='Linux';
        }
        return _os;
    }

    /**
     * Get multiple selection key.
     *
     * @return {string} returns 'contol' or 'command', depending on OS
     */
    static getMultipleSelectionKey()
    {
        return _keyControls[Environment.getOS()]['multiple'];
    }

    /**
     * Get range selection key.
     *
     * @return {string} returns range selection key (e.g. 'shift'), depending on OS
     */
    static getRangeSelectionKey()
    {
        return _keyControls[Environment.getOS()]['range'];
    }
}

import RODAN_EVENTS from './RODAN_EVENTS';
import Marionette from 'backbone.marionette';
import Radio from 'backbone.radio';

/**
 * General error handler.
 */
export default class ErrorHandler extends Marionette.Object
{
///////////////////////////////////////////////////////////////////////////////////////
// PUBLIC METHODS
///////////////////////////////////////////////////////////////////////////////////////
    /**
     * Initialize.
     */
    initialize()
    {
        this._initializeRadio();
        window.onerror = (errorText, url, lineNumber, columnNumber, error) => this._handleJavaScriptError(errorText, url, lineNumber, columnNumber, error);
    }

///////////////////////////////////////////////////////////////////////////////////////
// PRIVATE METHODS
///////////////////////////////////////////////////////////////////////////////////////
    /**
     * Initialize Radio.
     */
    _initializeRadio()
    {
        Radio.channel('rodan').reply(RODAN_EVENTS.REQUEST__SYSTEM_HANDLE_ERROR, (options) => this._handleError(options));
    }

    /**
     * Handles Javscript error.
     */
    _handleJavaScriptError(errorText, url, lineNumber, columnNumber, error)
    {
        var text = 'text: ' + errorText + '\n';
        text += 'url: ' + url + '\n';
        text += 'line: ' + lineNumber + '\n';
        text += 'column: ' + columnNumber;
    }

    /**
     * Handle error.
     */
    _handleError(options)
    {
        var response = options.response;
        var responseTextObject = response.responseText !== '' ? JSON.parse(response.responseText) : null;
        if (responseTextObject !== null)
        {
            if (responseTextObject.hasOwnProperty('error_code'))
            {
                this._processRodanError(options); // custom Rodan error code present
            }
            else
            {
                this._processHTTPError(options); // HTTP error
            }
        }
        else
        {
            alert(response.statusText);
        }
    }

    /**
     * Processes HTTP errors.
     */
    _processHTTPError(options)
    {
        var response = options.response;
        var responseTextObject = JSON.parse(response.responseText);
        var message = 'An unknown error occured.';

        // Look for message in options first.
        if (options.hasOwnProperty('message'))
        {
            message = options.message;
        }

        // Go through the response text.
        var first =  true;
        for(var property in responseTextObject)
        {
            if (responseTextObject.hasOwnProperty(property))
            {
                message += '\n';
                if (first)
                {
                    message += '\n';
                    first = false;
                }
                message += responseTextObject[property];
            }
        }
        alert(message);
    }

    /**
     * Processes Rodan-generated error response.
     */
    _processRodanError(options)
    {
        Radio.channel('rodan').trigger(RODAN_EVENTS.EVENT__SERVER_ERROR, {json: options.response.responseJSON});
    }
}

import RODAN_EVENTS from './RODAN_EVENTS';
import Marionette from 'backbone.marionette';
import Radio from 'backbone.radio';

/**
 * Timer that fires an event every X milliseconds.
 */
export default class EventTimer extends Marionette.Object
{
///////////////////////////////////////////////////////////////////////////////////////
// PUBLIC METHODS
///////////////////////////////////////////////////////////////////////////////////////
    /**
     * Initialize.
     *
     * @param {object} options options for EventTimer; options.frequency sets the frequency (in milliseconds) that a registered event will be fired
     */
    initialize(options)
    {
        this._initializeRadio();
        this._event = null;
        this._options = null;
        this._function
        this._frequency = options.frequency;
        this._timer = null;
    }

///////////////////////////////////////////////////////////////////////////////////////
// PRIVATE METHODS
///////////////////////////////////////////////////////////////////////////////////////
    /**
     * Initialize radio.
     */
    _initializeRadio()
    {
        Radio.channel('rodan').reply(RODAN_EVENTS.REQUEST__TIMER_SET_EVENT, (options) => this._handleSetTimedEvent(options));
        Radio.channel('rodan').reply(RODAN_EVENTS.REQUEST__TIMER_SET_REQUEST, (options) => this._handleSetTimedRequest(options));
        Radio.channel('rodan').reply(RODAN_EVENTS.REQUEST__TIMER_SET_FUNCTION, (options) => this._handleSetTimedFunction(options));
        Radio.channel('rodan').reply(RODAN_EVENTS.REQUEST__TIMER_CLEAR, () => this._handleClearTimedEvent());
    }

    /**
     * Handles call to set timed event.
     */
    _handleSetTimedEvent(options)
    {
        this._clearTimer();
        this._event = options.event;
        this._options = options.options;
        this._timer = setTimeout(() => this._fireEvent(), this._frequency);
    }

    /**
     * Handles call to set timed request.
     */
    _handleSetTimedRequest(options)
    {
        this._clearTimer();
        this._event = options.request;
        this._options = options.options;
        this._timer = setTimeout(() => this._fireRequest(), this._frequency);
    }

    /**
     * Handles call to set timed function.
     */
    _handleSetTimedFunction(options)
    {
        this._clearTimer();
        this._function = options.function;
        this._timer = setTimeout(() => this._fireFunction(), this._frequency);
    }

    /**
     * Handles call to clear timed event.
     */
    _handleClearTimedEvent(options)
    {
        this._clearTimer();
    }

    /**
     * Fires the event.
     */
    _fireEvent()
    {
        if (this._event != null)
        {
            Radio.channel('rodan').trigger(this._event, this._options);
            this._timer = setTimeout(() => this._fireEvent(), this._frequency);
        }
    }

    /**
     * Fires the request.
     */
    _fireRequest()
    {
        if (this._event != null)
        {
            var response = Radio.channel('rodan').request(this._event, this._options);
            this._timer = setTimeout(() => this._fireRequest(), this._frequency);
        }
    }

    /**
     * Fires the function.
     */
    _fireFunction()
    {
        if (this._function != null)
        {
            var response = this._function();
            this._timer = setTimeout(() => this._fireFunction(), this._frequency);
        }
    }

    /**
     * Handle timer test event.
     */
    _handleTimerTestEvent(options)
    {
        console.log('Fired Event ' + this._event + ' with options ' + this._options);
    }

    /**
     * Handle timer test request.
     */
    _handleTimerTestRequest(options)
    {
        console.log('Fired Request ' + this._event + ' with options ' + this._options);
        return true;
    }

    /**
     * Clears the timer.
     */
    _clearTimer()
    {
        if (this._timer !== null)
        {
            clearInterval(this._timer);
        }
        this._event = null;
        this._options = null;
        this._function = null;
    }
}

